import React from "react";
import { StyleSheet, Text, View } from "react-native";
import colors from "../config/colors";

function RequestItem({ provider_name, provider_rate, date_time, status }) {
  return (
    <View style={styles.container}>
      <View style={styles.line}>
        <Text numberOfLines={1} style={styles.provider_name}>
          {provider_name}
        </Text>
      </View>
      <Text style={styles.provider_rate}>{provider_rate}</Text>
      <Text>{date_time}</Text>
      if status
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: colors.babygrey,
    width: "100%",
    flex: 1,
    padding: 10,
    marginBottom: 5,
  },
  line: {
    paddingTop: 5,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  provider_rate: {
    color: colors.black,
    marginTop: 6,
    fontStyle: "italic",
  },
  provider_name: {
    fontWeight: "bold",
  },
});

export default RequestItem;
